import React from 'react';
import styled from 'styled-components';

const NowLogoutS = styled.div`
  cursor: pointer;
  text-align : center;
  line-height : 36px;
  width: ${(props) => props.width};
  height: 36px;
  font-size: 16px;
  text-align: center;
  font-family:'bitbit';
  font-weight: 1;
  margin-left: ${(props) => props.marginLeft};
  margin-right: ${(props) => props.marginRight};
  color: ${(props) => props.color};
`;

function NowLogout() {
  return <>
    <>
      <NowLogoutS marginLeft="auto" color='rgb(0,0,0)'>로</NowLogoutS>
      <NowLogoutS color='rgb(50,50,50)'>그인</NowLogoutS>
    </>
    <>
      <NowLogoutS marginLeft="20px" color='rgb(0,0,0)'>회</NowLogoutS>
      <NowLogoutS marginRight="50px" color='rgb(50,50,50)'>원가입</NowLogoutS>
    </>
  </>;
}

export default NowLogout;
